        public Atoll() { }

        public Atoll(string Name)
            : base(Name)
        {

        }

        public override void checkForMusic(GameTime time)
        {
            if (Game1.random.NextDouble() < 0.003 && Game1.timeOfDay < 1900)
            {
                localSound("seagulls");
            }

            base.checkForMusic(time);

            if (!Game1.IsMusicContextActive())
            {

                Game1.changeMusicTrack("ocean", true);

            }
        }

