        public void AddBoatAccess()
        {

            GameLocation beach = Game1.getLocationFromName("Beach");

            int x = 93;

            int y = 8;

            if (Mod.instance.Helper.ModRegistry.IsLoaded("aztecviper.fishofstardew"))
            {

                y = 15;

            }
            foreach (TileSheet tilesheet in beach.map.TileSheets)
            {

                if (tilesheet.ImageSource.Contains("beach"))
                {

                    Layer beachFront = beach.map.GetLayer("Front");

                    beachFront.Tiles[x - 1, y] = new StaticTile(beachFront, tilesheet, BlendMode.Alpha, 294);

                    beachFront.Tiles[x, y] = new StaticTile(beachFront, tilesheet, BlendMode.Alpha, 295);

                    beachFront.Tiles[x + 1, y] = new StaticTile(beachFront, tilesheet, BlendMode.Alpha, 296);

                    beachFront.Tiles[x - 1, y + 1] = new StaticTile(beachFront, tilesheet, BlendMode.Alpha, 311);

                    beachFront.Tiles[x, y + 1] = new StaticTile(beachFront, tilesheet, BlendMode.Alpha, 312);

                    beachFront.Tiles[x + 1, y + 1] = new StaticTile(beachFront, tilesheet, BlendMode.Alpha, 313);


                }

            }


            foreach (Warp warp in beach.warps)
            {

                if (warp.X == x && warp.Y == y)
                {

                    return;

                }

            }

            // Beach warps
            beach.warps.Add(new Warp(x, y, LocationHandle.druid_atoll_name, 14, 10, flipFarmer: false));

            beach.warps.Add(new Warp(x, y + 1, LocationHandle.druid_atoll_name, 14, 10, flipFarmer: false));

            beach.warps.Add(new Warp(x, y + 2, LocationHandle.druid_atoll_name, 14, 10, flipFarmer: false));

        }

